import React from "react";
import { Link, NavLink } from "react-router-dom";

export default function Header() {
  return (
    <header>
      <nav>
        <ul>
          <li>
            <NavLink to={"/"}>
            <img width="150px" alt="Business Trips" src="/images/logo.png" />
            </NavLink>
            <li>

            <NavLink to={"/meetings"}>meetings</NavLink>
            </li>
          </li>
        </ul>
      </nav>
    </header>
  );
}
